import { useEffect, useState } from "react";
import api from "../../api/axios";

const EmployeesPage = () => {
  const [employees, setEmployees] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    let isMounted = true;

    const fetchEmployees = async () => {
      try {
        setIsLoading(true);
        setError("");

        const response = await api.get("/employees");
        const data = Array.isArray(response.data) ? response.data : [];

        if (isMounted) {
          setEmployees(data);
        }
      } catch (err) {
        if (!isMounted) return;

        const message =
          err?.response?.data?.message ||
          err?.response?.data?.error ||
          "Failed to load employees. Please try again.";
        setError(message);
      } finally {
        if (isMounted) {
          setIsLoading(false);
        }
      }
    };

    fetchEmployees();

    return () => {
      isMounted = false;
    };
  }, []);

  return (
    <div>
      <h1>Employees</h1>
      <p>This page lists employees from the backend. CRUD will be added later.</p>

      {isLoading && <p>Loading employees...</p>}

      {!isLoading && error && <p style={{ color: "red" }}>{error}</p>}

      {!isLoading && !error && employees.length === 0 && <p>No employees found.</p>}

      {!isLoading && !error && employees.length > 0 && (
        <div style={{ overflowX: "auto", marginTop: "1rem" }}>
          <table
            style={{
              width: "100%",
              borderCollapse: "collapse",
              minWidth: "700px",
            }}
          >
            <thead>
              <tr>
                <th style={thStyle}>Name</th>
                <th style={thStyle}>Email</th>
                <th style={thStyle}>Employee Code</th>
                <th style={thStyle}>Department</th>
                <th style={thStyle}>Designation</th>
                <th style={thStyle}>Salary</th>
                <th style={thStyle}>Date of Joining</th>
              </tr>
            </thead>
            <tbody>
              {employees.map((emp) => (
                <tr key={emp.id}>
                  <td style={tdStyle}>{emp.user?.name || "-"}</td>
                  <td style={tdStyle}>{emp.user?.email || "-"}</td>
                  <td style={tdStyle}>{emp.employee_code || "-"}</td>
                  <td style={tdStyle}>{emp.department?.name || "-"}</td>
                  <td style={tdStyle}>{emp.designation || "-"}</td>
                  <td style={tdStyle}>{emp.salary ?? "-"}</td>
                  <td style={tdStyle}>{emp.date_of_joining || "-"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

const thStyle = {
  textAlign: "left",
  borderBottom: "1px solid #e5e7eb",
  padding: "0.5rem",
  fontSize: "0.875rem",
  fontWeight: 600,
};

const tdStyle = {
  borderBottom: "1px solid #f3f4f6",
  padding: "0.5rem",
  fontSize: "0.875rem",
};

export default EmployeesPage;
